import React from 'react'
import IphoneWallpaper from "./images/iphonewallpaper.png"; 

export default function iphone() {
    return (
        <div className="iphone-background" img={IphoneWallpaper}>
            {/* <img src={IphoneWallpaper} alt="" className="iphone-wallpaper"/> */}
            <div class="iphone"></div>
            <div class="circle"></div>
            <div class="camera"></div>
            <div class="speaker"></div>
            <div class="screen"></div>
            <div class="home1"></div>
            <div class="home2"></div>
            <div class="highlight"></div>
            <div class="line"></div>
        </div>
    );
};
